$(document).ready(function(){$("#btnSearch").button({icons:{primary:"ui-icon-search"}}).on("click",function(b){var a=$(this).closest("form");$.ajax({url:a.attr("action"),data:a.serializeArray(),type:"GET",cache:false,statusCode:{200:function(c,e,d){window.location.href=c;return true},203:function(c,e,d){$("#layoutError").text(c).show()}}}).fail(function(d,e,c){alert(d.responseText)});return false})});$(document).ready(function(){$("#tabs").tabs();$("button").button();$("#btnPrintNow").button({icons:{primary:"ui-icon-print"}});$("#CurrentBatch table tbody tr a.ui-icon-print").on("click",function(a){var b=$("#frmPrintBatch input[type=radio]:checked");var c=$(a.target).attr("data-uccid");if($(b).length==0){$("#divInfo").removeClass("ui-state-highlight").addClass("ui-state-error").find("span.info-message").html("Please select a printer from list.").end().find("span:eq(1)").removeClass("ui-icon-info").addClass("ui-icon-alert").end().show();return false}$("#hfUccId").val(c);$("#hfSelectedPrinter").val($(b).val());if(confirm("Are you sure, you want to print the label for Box "+c)){$.ajax({url:$("#frmPrintDialog").attr("action"),data:$("#frmPrintDialog").serializeArray(),type:"POST",cache:false}).done(function(d,f,e){$(a.target).closest("tr").find("td.ucc-print-date").text("Printed Now").addClass("ui-state-highlight");$("#divInfo").removeClass("ui-state-error").addClass("ui-state-highlight").find("span.info-message").html(d).end().find("span:eq(1)").removeClass("ui-icon-alert").addClass("ui-icon-info").end().show()}).fail(function(e,f,d){$("#divInfo").removeClass("ui-state-highlight").addClass("ui-state-error").find("span.info-message").html(e.responseText).end().find("span:eq(1)").removeClass("ui-icon-info").addClass("ui-icon-alert").end().show()})}return false})});